css:
atom-text-editor {
  background-color: #0E1419;
  color: #F8F8F2;
}
atom-text-editor .cursor {
  position: absolute;
  border-left: #8BE9FD solid 2px;
  background-color: transparent;
}
atom-text-editor .line-number {
  opacity: 1.0;
}
atom-text-editor .gutter {
  color: #6272A4;
  background: transparent;
}
atom-text-editor .gutter .cursor-line {
  color: #8BE9FD;
}
atom-text-editor .highlight.find-result .region {
  background-color: rgba(255, 255, 255, 0.4);
  border: none;
  border-radius: 0;
}
atom-text-editor .highlight.current-result .region {
  background-color: rgba(255, 184, 108, 0.8);
  border: none;
  border-radius: 0;
}
atom-text-editor .highlight.datatip-highlight-region .region {
  background-color: #191A21;
}
atom-text-editor .invisible-character {
  color: #424450;
}
atom-text-editor .indent-guide {
  color: #26272e;
}
atom-text-editor .leading-whitespace.indent-guide {
  color: #424450;
}
atom-text-editor .bracket-matcher .region {
  border: none;
}
.editor.has-selection.is-focused .highlight.selection .region {
  background-color: #44475A;
  border-color: #FFB86C;
  border-width: 1px;
  border-style: solid;
}
.editor.is-focused .line.cursor-line {
  background-color: #253340;
  border: none;
}
atom-text-editor .highlight.code-highlight-marker .region {
  background-color: rgba(139, 233, 253, 0.5);
  border: none;
  border-radius: 0;
}
.syntax--entity.syntax--name.syntax--class,
.syntax--entity.syntax--name.syntax--type.syntax--class {
  color: #50FA7B;
}
.syntax--entity.syntax--inherited-class {
  color: #8BE9FD;
}
.syntax--comment {
  color: #6272A4;
}
.syntax--constant {
  color: #FFB86C;
}
.syntax--constant.syntax--escape {
  color: #FF79C6;
}
.syntax--function.syntax--name {
  color: #50FA7B;
}
.syntax--function.syntax--name.syntax--declaration {
  color: #50FA7B;
}
.syntax--parameter.syntax--variable {
  color: #FFB86C;
}
.syntax--meta.syntax--method-call .syntax--name.syntax--function {
  color: #8BE9FD;
}
.syntax--keyword {
  color: #FF79C6;
}
.syntax--keyword.syntax--new {
  font-weight: bold;
}
.syntax--punctuation.syntax--separator {
  color: #FF79C6;
}
.syntax--bracket {
  color: #F8F8F2;
}
.syntax--string {
  color: #F1FA8C;
}
.syntax--entity.syntax--name.syntax--type {
  color: #8BE9FD;
}
.syntax--storage.syntax--type {
  color: #FFB86C;
}
.syntax--storage.syntax--modifier {
  color: #FF79C6;
}
.syntax--variable {
  color: #F8F8F2;
}
.syntax--variable.syntax--property {
  color: #F8F8F2;
}
